const LogIn = async () => {

    const login = async () => {
        let res = await fetch('http://127.0.0.1:5000/login', {body: 
        JSON.stringify({"email": "v@k.com","password": "123123" })})
        alert(res.json())
        return res.json()
    }
    return (
        <div>
        <from>
            <input type="text" placeholder='email'></input>
            <input type="password" placeholder='password'></input>
            <input type="submit" onSubmit={login}>LogIn</input>
        </from>
        </div>
  )
}

export default LogIn
